import './App.css';
import Error from './error/error.js';
import Login from './login/login.js'
import NavBar from './navbar/NavBar.js';

function App() {
  const [error, setError] = useState(false);
  return (
    <div className="App">
      <header>
        <NavBar/>
      </header>
      {error && <Error/>}
      <Login setError={(err) => setError(err)}/>
    </div>
  );
}

export default App;
